    "zb.om.return.box3a.desc": "إجمالية قيمة توريدات البضائع والخدمات المطبق عليها الإعفاء الضريبي عند تصديرها. يستثني أي توريدات خارج النطاق.",
    "zb.om.return.box4a.desc": "إجمالي قيمة البضائع المستوردة (باستثناء ضريبة القيمة المضافة) التي تم تأجيل ضريبة القيمة المضافة لها عند الاستيراد.",
    "zb.om.return.box4b.desc": "القيمة الإجمالية لجميع الواردات (باستثناء ضريبة القيمة المضافة)، بما في ذلك البضائع المستثناة/المعفاة من الضرائب وتلك التي تم سداد ضريبة القيمة المضافة لاستيرادها لدى الإدارة العامة للجمارك. يستثني الواردات المذكورة في المربع 4a.",
    "zb.om.return.box5a.desc": "إجمالي ضريبة القيمة المضافة المستحقة على المعاملات في هذه الفترة قبل التسويات الواردة في المربع التالي.",
    "zb.om.return.box5b.desc": "أي تسويات لضريبة القيمة المضافة المستحقة للمخرجات التي يجب الإعلان عنها في هذه الفترة بما في ذلك الديون المعدومة المرتبطة بالتوريدات المسعرة قياسيًا والمبالغ المستردة والمرتجعات وأي تسويات أخرى تؤثر على ضريبة القيمة المضافة المستحقة.",
    "zb.om.return.box6a.desc": "<b>العمود 1 (عمود المبلغ)</b>: القيمة الإجمالية لجميع المشتريات (باستثناء ضريبة القيمة المضافة) بما في ذلك المشتريات المستثناة/القياسية/المعفاة من الضرائب والمشتريات التي تخضع لآلية الاحتساب العكسي. يستثني البضائع المستوردة والمصروفات التي تتم خارج النطاق ومشتريات الأصول الثابتة (الرأسمالية). <br> <b>العمود 2 (عمود مبلغ ضريبة القيمة المضافة)</b>: ضريبة القيمة المضافة القابلة للخصم المتعلقة بمشترياتك. يجب أن يأتي المبلغ المعلن عنه بعد تطبيق أي مبلغ مخصص مطلوب. يستثني ضريبة القيمة المضافة القابلة للخصم على الأصول الثابتة (الرأسمالية).",
    "zb.om.return.box6b.desc": "<b>العمود 1 (عمود المبلغ)</b>: القيمة الإجمالية (باستثناء ضريبة القيمة المضافة) للواردات المسعرة قياسيًا من البضائع سواء كانت مؤجلة أم لا. <br> <b>العمود 2 (عمود مبلغ ضريبة القيمة المضافة)</b>: ضريبة القيمة المضافة القابلة للخصم المتعلقة بالبضائع المستوردة. يجب أن يأتي المبلغ المعلن عنه بعد تطبيق أي مبلغ مخصص مطلوب.",
    "zb.om.return.box6c.desc": "ضريبة القيمة المضافة المخصومة المتعلقة بشراء أو حيازة أو إنشاء أصول رأسمالية. يجب أن يأتي المبلغ المعلن عنه بعد تطبيق أي مبلغ مخصص مطلوب.",
    "zb.om.return.box6d.desc": "أي تسويات لضريبة القيمة المضافة القابلة للخصم التي يجب الإعلان عنها في هذه الفترة بما في ذلك الديون المعدومة المتعلقة بالتوريدات المسعرة قياسيًا والمبالغ المستردة والمرتجعات وأي تسويات أخرى تؤثر على ضريبة القيمة المضافة القابلة للخصم.",
    "zb.om.return.box7a.desc": "إجمالي القيمة إذا كانت ضريبة القيمة المضافة مستحقة في هذه الفترة.",
