    "zb.updatetds.popup.limit3": "Manually edited TDS amount in recurring transactions will be reset with the revised TDS rates. To check the associated transactions for TDS rates, go to <span class=\"text-blue cursor-pointer\">Direct Taxes</span> and select <b>View Associated Entries</b> in the dropdown next to the respective Tax Name.",
