    "zb.gocardless.payment.processing": "يستخدم GoCardless الخصم المباشر لتحصيل المدفوعات من عملائك. عادة ما تستغرق عملية الخصم المباشر 5-7 أيام عمل لمعالجة عملية الدفع. هذا يعني أن عملائك سيتمكنون من التسجيل في منتجك من خلال صفحات الدفع المستضافة، لكنك لن تتلقى مدفوعاتهم إلا بعد يومين.",
    "zb.gocardless.canceling.payments": "باستخدامك لـ GoCardless على صفحات الدفع المستضافة الخاصة بك، أنت تتحمل بعض المخاطرة لأنك ربما لا تحصل على مدفوعات عميلك إذا قرر إلغاء عملية الدفع قبل أن تصل إليك.",
    "zb.stripe.unconfigured.desc": "Stripe هو عبارة عن منصة لمعالجة الدفع عبر الإنترنت تتيح لك استلام مدفوعات لمرة واحدة ومتكررة بشكل آمن من العملاء. كما يدير جميع مدفوعاتك ويجعل من تسوياتك أمرًا في غاية السهولة. يمكنك إعداده في وقت لا يُذكر والحصول على أموال بشكل أسرع.",
    "zb.stripe.unconfigured.desc1": "Stripe is an online payment processing platform that allows you to receive one-time payments securely from customers. It also manages all your payments and makes reconciliation a breeze. You can set it up in no time and get paid faster.",
    "zb.square.unconfigured.desc": "Square هو مزود حلول معالجة بطاقات الائتمان ونقاط البيع. قم بإعداد Square لقبول المدفوعات سريعًا وبأمان مقابل رسوم معالجة قليلة.",
    "zb.wepay.unconfigured.desc": "WePay هي منصة معالجة مدفوعات تمكّنك من تحصيل المدفوعات وسدادها بدون مشكلات أو احتيال.",
    "zb.worldpay.unconfigured.desc": "Worldpay هي شركة معالجة مدفوعات آمنة تمكّن الأعمال من قبول المدفوعات عبر الإنترنت ومن خلال الهواتف المحمولة من أي مكان في العالم.",
    "zb.paypal.paymentspro.unconfigured.desc": "PayPal Payments Pro هو حل قابل للتخصيص بشكل كامل يمكّنك من قبول معظم بطاقات الائتمان وبطاقات الخصم المباشر وPaypal وPaypal Credit.",
    "zb.braintree.unconfigured.desc": "Braintree Payments هو حل شامل لقبول المدفوعات ومعالجتها من خلال هاتفك المحمول وعلى الويب. قم بإعداد Braintree لقبول المدفوعات من خلال العديد من العملات من أكثر من 45 دولة.",
    "zb.2checkout.unconfigured.desc": "2Checkout تمكّن الأعمال من قبول مدفوعات الهواتف المحمولة والإنترنت من المشترين حول العالم. مثالي للأعمال التي تبيع منتجات حول العالم.",
    "zb.paypal.unconfigured.desc": "PayPal هي الطريقة الأسرع والأكثر أمانًا لإرسال الأموال والدفع عبر الإنترنت واستلام الأموال أو إعداد حساب تجاري.",
    "zb.paypal.unconfigured.newdesc": "PayPal lets you seamlessly accept and manage all major payment types, including PayPal, Venmo (US), and Buy Now Pay Later (BNPL) within a single solution.",
    "zb.paypal.payflowpro.unconfigured.desc": "Paypal Payflow Pro هي بوابة دفع آمنة ومفتوحة تستخدم لمعالجة مدفوعات بطاقات الائتمان والخصم المباشر ومدفوعات PayPal Credit والتفويضات والمزيد.",
    "zb.authorizenet.unconfigured.desc": "Authorize.Net يساعد الأعمال على معالجة المدفوعات عبر الإنترنت والهاتف المحمول وبطاقات الائتمان والشيكات الإلكترونية والمزيد. قم بإعداد التكامل لتحصل على مستحقاتك في الوقت المحدد.",
    "zb.forte.unconfigured.desc": "Forte توفر مجموعات من حلول الدفع والتي يمكن أن تتطور مع أعمالك. قم بالإعداد لقبول المدفوعات بأي طريقة تريد: عبر الإنترنت، وعلى الهواتف المحمولة، وبشكل شخصي ومكرر.",
    "zb.gocardless.unconfigured.desc": "GoCardless، حل للخصم المباشر يمكّن الأعمال من جمع مدفوعات المرة الواحدة والمتكررة بشكل آلي. قم بإعداد التكامل لتقبل المدفوعات من شتى بلاد العالم.",
    "zb.gocardless.currencysupport": "Supported payment methods (currency-wise): <br>GBP - BACS, EUR - SEPA Direct Debit, AUD - BECS Direct Debit, <br>CAD - PAD, NZD - BECS  Direct Debit",
