    "zb.sms.banner.info": "{{serviceName}} uses shortened URLs in the Call to Actions (CTAs) of SMSes for all transactions, including invoices, {{estimate.plural.lowercase}}, payment links, and payment retry. As per TRAI's latest regulations, only whitelisted CTAs are allowed starting <b>October 1, 2024</b>. To ensure uninterrupted communication, kindly complete this process at the earliest.",
